// src/pages/CoursesPage.js
import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import '../css/coursepage.css';

const courses = [
  { id: 1, title: 'Gestión de proyectos', code: '1I33N', status: 'En curso' },
  { id: 2, title: 'Inteligencia de Negocios', code: '1I62N', status: 'En curso' },
  { id: 3, title: 'Programación de Interfaces y Dispositivos Periféricos', code: '1S08F', status: 'En curso' },
  { id: 4, title: 'Ética Profesional', code: '1N12I', status: 'En curso' },
];

const CoursesPage = () => {
  return (
    <div>
      <h1>Mis Cursos</h1>
      <div>
        {courses.map((course) => (
          <div key={course.id} className="course-card">
            <h2>{course.title} ({course.code})</h2>
            <p>{course.status}</p>
            <Link to={`/course/${course.id}`}>Ver detalles</Link>
          </div>
        ))}
      </div>
    </div>
  );
};

export default CoursesPage;
